import React, { useState, useEffect, Fragment} from 'react'
import axios from 'axios'

const Interns = () => {
    const [interns, setInterns] = useState([])

    useEffect(()=> {

        axios.get('/api/v1/interns.json')
        .then( resp => {
            setInterns(resp.data.data)
        })
        .catch( resp => console.log(resp) )
    }, [interns.length])

    const list = interns.map ( item => {
        return (<li key={item.attribute.id}>{item.attribute.id}</li>)
    })

    return (
        <Fragment>
            <div>This is Inters#index view</div>
            <ul>{list}</ul>
        </Fragment>
    )
}

export default Interns
